	this.model = model;

	this.canvas.height = this.model.getDimension().height;
	this.model.subscribe(this);

	this.x = x;

	this.matrix = [[1, 0, 0], [0, 1, 0], [0, 0, 1]];

JSketchView.prototype.notify = function() {
	this.context.clearRect(0, 0, this.canvas.width, this.canvas.height);

	for (var i = 0; i < strokes.length; ++i)
		this.paintStroke(strokes[i]);

		this.context.lineTo(points[i].x, points[i].y);

};

// JSketchModel Prototype Definition
JSketchModel.prototype.subscribe = function(observer) {
	if (typeof observer.notify === 'function')

JSketchModel.prototype.getDimension = function() {

};

	var strokes = [];

			strokes.push(this.project.strokes[i]);

};

JSketchModel.prototype.getCurrentFrame = function() {
